import Logo from "./logo.png";
import Account from "./account_circle.png";

export const Header = () => {
  return (
    <header className="bg-primary hover:bg-secondary text-white font-bold py-4 px-6 rounded shadow-lg flex justify-between items-center">
      {/* Логотип */}
      <div className="flex items-center">
        <img src={Logo} alt="Logo" className="h-12 w-auto" />
      </div>

      {/* Навигационное меню */}
      <nav>
        <ul className="flex space-x-6 ">
          <li className="//styleName: H5 18pt;
font-family: SF Pro Display;
font-size: 18px;
font-weight: 400;
line-height: 21.48px;
text-align: left;
">
            Главная
          </li>
          <li className="hover:text-secondary cursor-pointer">О нас</li>
          <li className="hover:text-secondary cursor-pointer">Помощь</li>
          <li className="hover:text-secondary cursor-pointer">
            +7 495 967 13 01
          </li>
        </ul>
      </nav>

      {/* Личный кабинет */}
      <div className="flex items-center">
        <div className="mr-2">Личный кабинет</div>
        <img src={Account} alt="Account" className="h-10 w-auto" />
      </div>
    </header>
  );
};
